import { Component } from '@angular/core';
import { ActivatedRoute, Params } from '@angular/router';
import { HttpClient } from '@angular/common/http';
import { Observable, of } from 'rxjs';
import { catchError, map } from 'rxjs/operators';

@Component({
  selector: 'app-about',
  templateUrl: './about.component.html',
  styleUrls: ['./about.component.css']
})
export class AboutComponent {
  apiLoaded: Observable<boolean>;

  inicio!: {navabout: string};


  constructor(private rutaActiva: ActivatedRoute, httpClient: HttpClient) {
    this.apiLoaded = httpClient.jsonp('https://maps.googleapis.com/maps/api/js?key=AIzaSyCPd2D-O7mbfA8B2x7n60X9rsXx3B2J0Bs', 'callback')
    .pipe(
      map(() => true),
      catchError(() => of(false)),
    );
  }

  ngOnInit() {
    this.inicio = {
      navabout: this.rutaActiva.snapshot.params['navabout'],
    };
    this.rutaActiva.params.subscribe(
    (params: Params) => {
    this.inicio['navabout'] = params['navabout'];
    }
    );

    }

}
